      Hint: Content
      Value: |
        A mosquito&ndash;borne disease is a disease transmitted through a mosquito bite. Female mosquitoes feed on humans and other mammals for the protein they need to reproduce. When they do, they can transfer diseases such as West Nile virus, malaria, yellow fever, dog heartworm and viral encephalitis. Mosquito-borne diseases are among the world's leading causes of illness and death. For more information about these specific illnesses, <a href="~/link.aspx?_id=9343802E38D14D1CBD6EBAFA84868ADA&amp;_z=z"><span style="text-decoration: underline;">view the disease information page.</span></a>
